import React from 'react'
import './patro.css'

const Patro = (props) => {
  let urlI = ''
  if(props.patro.url.lenght > 0){
    urlI = props.patro.url
  }
  console.log(urlI +'a')
  return (
    <a href={urlI}>
      <div>
          <img src={props.patro.img} />
          <h3>{props.patro.nombre}</h3>
      </div>
    </a>
  )
}

export default Patro
